package io.sfer.xxx.Model;

import javax.persistence.*;
import lombok.*;

@Entity
@Table(name = "cart")
@Data
@NoArgsConstructor
@AllArgsConstructor
@Getter
@Setter
public class Cart {

  @Id
  @GeneratedValue(strategy = GenerationType.IDENTITY)
  Integer id;

  @column(name = "quantity", nullable = false)
  Integer quantity;

  @column(name = "product_id", nullable = false)
  Integer product_id;

  @ManyToOne(cascade = CascadeType.REMOVE, fetch = FetchType.LAZY)
  @JoinColumn(
    name = "product_id",
    referencedColumnName = "id",
    foreignKey = @ForeignKey(name = "FK_product_productcustomer"),
    insertable = false,
    updatable = false,
    nullable = false
  )
  @JsonIgnoreProperties(value = { "applications", "hibernateLazyInitializer" })
  Product product;

  @column(name = "customer_id", nullable = false)
  Integer customer_id;

  @ManyToOne(cascade = CascadeType.REMOVE, fetch = FetchType.LAZY)
  @JoinColumn(
    name = "customer_id",
    referencedColumnName = "id",
    foreignKey = @ForeignKey(name = "FK_customer_productcustomer"),
    insertable = false,
    updatable = false,
    nullable = false
  )
  @JsonIgnoreProperties(value = { "applications", "hibernateLazyInitializer" })
  Customer customer;
}
